var Minimatch=require("../minimatch.js").Minimatch;var tap=require("tap");tap.test("cache test",function(b){var d=new Minimatch("a?b");var c=new Minimatch("a?b");b.equal(d,c,"should get the same object");for(var a=0;a<100;a++){new Minimatch("a"+a)}c=new Minimatch("a?b");b.notEqual(d,c,"cache should have dropped");b.end()});